import React from "react";
import { FiDownload, FiMail, FiGithub, FiLinkedin } from "react-icons/fi";
import { motion } from "framer-motion";

export default function App() {
  const projects = [
    {
      title: "Selenium Hybrid Automation Framework",
      desc: "Hybrid framework using POM and Data-Driven approach with HTML reporting and Jenkins CI/CD integration.",
      repo: "https://github.com/iamajjayya/selenium-hybrid-framework",
      tags: ["Python", "Selenium", "Pytest", "POM", "CI/CD"],
    },
    {
      title: "API Automation Framework",
      desc: "Automated REST API testing with endpoint validation, status code checks, and response verification.",
      repo: "https://github.com/iamajjayya/api-automation",
      tags: ["Python", "Pytest", "Requests", "API"],
    }
  ];

  const skills = [
    "Manual Testing",
    "Functional & Regression Testing",
    "Sanity & Smoke Testing",
    "Cross-Browser Testing",
    "Bug Reporting",
    "Selenium WebDriver",
    "Python",
    "Pytest",
    "API Testing",
    "SQL",
    "HTML/CSS/JavaScript",
    "React.js",
    "Postman",
    "Git/GitHub",
    "Jira",
    "Jenkins"
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-50 to-gray-200 p-6 lg:p-12">
      <div className="max-w-5xl mx-auto">
        {/* Header */}
        <motion.header 
          initial={{ opacity: 0, y: -30 }} 
          animate={{ opacity: 1, y: 0 }} 
          transition={{ duration: 0.6 }}
          className="flex flex-col sm:flex-row items-start sm:items-center justify-between mb-10 gap-4"
        >
          <div>
            <h1 className="text-4xl font-extrabold bg-gradient-to-r from-indigo-600 to-purple-600 bg-clip-text text-transparent">
              Ajjayya G V â€” QA / Automation Tester
            </h1>
            <p className="mt-1 text-sm text-gray-600">Electronic City, Bengaluru | DOB: 05-04-2002 | 6366325113</p>
          </div>
          <motion.a 
            whileHover={{ scale: 1.05 }} 
            href="/resume.pdf" 
            className="inline-flex items-center gap-2 px-4 py-2 bg-gradient-to-r from-indigo-600 to-purple-600 text-white rounded-lg shadow-lg"
          >
            <FiDownload /> Resume
          </motion.a>
        </motion.header>

        {/* Profile Summary */}
        <motion.section 
          initial={{ opacity: 0, y: 30 }} 
          animate={{ opacity: 1, y: 0 }} 
          transition={{ delay: 0.2, duration: 0.6 }}
          className="backdrop-blur-md bg-white/70 rounded-2xl p-6 shadow-md mb-8"
        >
          <h2 className="text-xl font-semibold mb-2">Profile Summary</h2>
          <p className="text-gray-700 leading-relaxed">
            Detail-oriented QA Tester with professional experience in manual testing of web and ad-tech platforms. Skilled in executing functional, regression, sanity, and smoke testing, validating ad integrations, and collaborating with developers for issue resolution. Strong knowledge of Selenium automation and API testing through personal projects, with a commitment to transitioning into full automation roles.
          </p>
          <div className="mt-4 flex flex-wrap gap-2">
            {skills.map((s) => (
              <motion.span 
                key={s} 
                whileHover={{ scale: 1.1 }}
                className="px-3 py-1 rounded-full bg-gradient-to-r from-gray-100 to-gray-200 text-sm shadow-sm"
              >
                {s}
              </motion.span>
            ))}
          </div>
        </motion.section>

        {/* Projects */}
        <section className="mb-8">
          <h3 className="text-lg font-semibold mb-4">Projects</h3>
          <div className="grid grid-cols-1 sm:grid-cols-2 gap-6">
            {projects.map((p, i) => (
              <motion.article 
                key={p.title} 
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: 0.2 + i * 0.1 }}
                whileHover={{ scale: 1.03 }}
                className="bg-white rounded-xl p-5 shadow-md hover:shadow-lg transition"
              >
                <h4 className="font-semibold text-indigo-700">{p.title}</h4>
                <p className="text-gray-600 text-sm mt-2">{p.desc}</p>
                <div className="mt-3 flex items-center justify-between">
                  <div className="flex gap-2 flex-wrap">
                    {p.tags.map((t) => (
                      <span key={t} className="text-xs px-2 py-1 bg-indigo-50 text-indigo-700 rounded">
                        {t}
                      </span>
                    ))}
                  </div>
                  <a href={p.repo} target="_blank" rel="noreferrer" className="text-sm hover:underline flex items-center gap-2 text-indigo-600">
                    View Repo <FiGithub />
                  </a>
                </div>
              </motion.article>
            ))}
          </div>
        </section>

        {/* Footer */}
        <motion.footer 
          initial={{ opacity: 0, y: 30 }} 
          animate={{ opacity: 1, y: 0 }} 
          transition={{ delay: 0.4 }}
          className="bg-white rounded-2xl p-6 shadow-md flex flex-col sm:flex-row items-start sm:items-center justify-between gap-4"
        >
          <div>
            <div className="font-semibold">Let's collaborate</div>
            <div className="text-sm text-gray-600">Manual & automation testing, framework design, CI/CD pipelines.</div>
          </div>
          <div className="flex gap-4 items-center">
            <a href="mailto:ajjayya2002@gmail.com" className="flex items-center gap-2 hover:underline"><FiMail /> Email</a>
            <a href="https://github.com/iamajjayya" target="_blank" rel="noreferrer" className="flex items-center gap-2"><FiGithub /> GitHub</a>
            <a href="https://linkedin.com/in/ajjayya-gv" target="_blank" rel="noreferrer" className="flex items-center gap-2"><FiLinkedin /> LinkedIn</a>
          </div>
        </motion.footer>
      </div>
    </div>
  );
}
